  [],\n\t\"revision_timestamp\": \"2016-02-29T05:46:08.221685\",\n\t\"name\": \"partial-pressure-or-fugacity-of-carbon-dioxide-salinity-and-other-variables-collected-from-timeef3e7\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0115402 includes time series
  data collected from MOORINGS in the North Atlantic Ocean from 2006-07-13 to 2013-07-09
  and retrieved during cruise NH__20060713, NH__20070829, NH__20081014, NH__20081209,
  NH__20090902, NH__20100908, NH__20110706 and NH__20120822. These data include AIR-SEA
  DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, OXYGEN - PERCENT
  SATURATION, Partial pressure (or fugacity) of carbon dioxide - atmosphere, Partial
  pressure (or fugacity) of carbon dioxide - water, SALINITY and SEA SURFACE TEMPERATURE.
  The instruments used to collect these data include Bubble type equilibrator for
  autonomous carbon dioxide (CO2) measurement, Carbon dioxide (CO2) gas analyzer,
  Humidity Sensor, oxygen meter and thermosalinographs.nnThese data were collected
  by Adrienne Sutton, Christopher Sabine and Stacy Maenner of US DOC; NOAA; OAR; Pacific
  Marine Environmental Laboratory and Douglas Vandemark of University of New Hampshire
  as part of the Mooring_NH_70W_43N_Aug2007_Jun2008, Mooring_NH_70W_43N_Aug2012_Jul2013,
  Mooring_NH_70W_43N_Dec2008_Jul2009, Mooring_NH_70W_43N_Jul2006_Oct2006, Mooring_NH_70W_43N_Jul2011_Jun2012,
  Mooring_NH_70W_43N_Oct2008_Nov2008, Mooring_NH_70W_43N_Sep2009_Jul2010 and Mooring_NH_70W_43N_Sep2010_Apr2011
  data set.nnThe Global CO2 Time-series and Moorings Project involves international
  groups from 18 countries who have mounted sensors on moored buoys to provide high
  resolution time-series measurements of atmospheric boundary layer and surface ocean
  CO2 partial pressure (pCO2). The CO2 Time-series and Moorings Project is coordinated
  by UNESCO International Ocean Carbon Coordination Project (IOCCP).\",\n\t\"license_title\":
